import React, { Component } from "react";
import Olympics from "./Olympics";

class Brand extends Component {
  render() {
    return (
      <>
        {props.brand.map((brand, idx) => (
          <Olympics key={idx} brand={brand} />
        ))}
      </>
    );
  }
}

export default Brand;
